    <style>
	body{padding-top:60px}
    ul.emoji-list *,ul.emoji-list li span img {
      -webkit-user-select: none;
      -moz-user-select: none;
      -ms-user-select: none;
      user-select: none;
    }
	ul.emoji-list li span img{user-drag: none;pointer-events: none;}
    ul.emoji-list li {
      font-size: 16px;
      float: left;
      display: inline-block;
      padding: 2px;
      margin: 4px;
	  opacity:.6;
    }
	ul.emoji-list {
	  position:relative;
    }
	ul.emoji-list:after{
		content:"";
		display:block;
		clear:both;
	}
    img.emoji {
      cursor: pointer;
      height: 1em;
      width: 1em;
      margin: 0 .05em 0 .1em;
      vertical-align: -0.1em;
    }
	ul.emoji-list li span{
      position:absolute;
	  bottom:100%;
	  display:none;
	  left:50%;
	  margin-left:-36px;
    }
	ul.emoji-list li:hover{
      opacity:1
    }
	ul.emoji-list li:hover span{
      display:block
    }
    </style>
